    {
      "end": 565.606,
      "speaker_label": "SPEAKER_00",
      "start": 563.884,
      "text": "178 I see today."
    },
    {
      "end": 566.727,
      "speaker_label": "SPEAKER_00",
      "start": 565.626,
      "text": "Is that correct?"
