      "end": 596.568,
      "speaker_label": "SPEAKER_00",
      "start": 595.347,
      "text": "Small wins are just as good."
    },
    {
      "end": 598.21,
      "speaker_label": "SPEAKER_01",
      "start": 597.229,
      "text": "I guess, I guess."
    },
    {
      "end": 602.455,
      "speaker_label": "SPEAKER_01",
      "start": 598.49,
      "text": "You're right, and so anyway, that's where I'm at."
