      "end": 604.497,
      "speaker_label": "SPEAKER_01",
      "start": 602.775,
      "text": "But the scale is not my friend."
    },
    {
      "end": 608.691,
      "speaker_label": "SPEAKER_00",
      "start": 604.865,
      "text": "And then physical activity across six days, you did 319 minutes."
