    {
      "end": 626.338,
      "speaker_label": "SPEAKER_01",
      "start": 623.273,
      "text": "But the swimming is always kind of hard to judge."
    },
    {
      "end": 629.923,
      "speaker_label": "SPEAKER_01",
      "start": 626.758,
      "text": "I mean, for me, you know, I think I'm kind of out of breath when I'm done."
    },
    {
      "end": 632.627,
      "speaker_label": "SPEAKER_01",
      "start": 629.963,
      "text": "But I'm not sure I'm..."
