    {
      "end": 637.035,
      "speaker_label": "SPEAKER_01",
      "start": 633.029,
      "text": "exerting the same energy every single stroke I take."
    },
    {
      "end": 642.262,
      "speaker_label": "SPEAKER_01",
      "start": 637.295,
      "text": "On the other hand, I'm in the pool because of this study, so, you know, there's good stuff."
