      "end": 689.374,
      "speaker_label": "SPEAKER_01",
      "start": 688.152,
      "text": "Yep."
    },
    {
      "end": 689.494,
      "speaker_label": "SPEAKER_01",
      "start": 689.394,
      "text": "Okay."
